'use strict';

var usernamePage = document.querySelector('#username-page');
var chatPage = document.querySelector('#chat-page');
var usernameForm = document.querySelector('#usernameForm');
var messageForm = document.querySelector('#messageForm');
var messageInput = document.querySelector('#message');
var messageArea = document.querySelector('#messageArea');
var connectingElement = document.querySelector('.connecting');

var stompClient = null;
var username = null;
var receiver = null;
var access_token = null;
var matchId = 5;

var colors = [
    '#2196F3', '#32c787', '#00BCD4', '#ff5652',
    '#ffc107', '#ff85af', '#FF9800', '#39bbb0'
];

function connect(event) {
    username = document.querySelector('#name').value.trim();
    receiver = document.querySelector('#receiver').value.trim();

    if(username) {
        
        usernamePage.classList.add('hidden');
        chatPage.classList.remove('hidden');
        
        getToken(username)
        .then(response => response.json())
        .then(json => json.access_token)
        .then(token => {
            access_token = token
            var socket = new SockJS('http://x.x.x.x:8091/ws?access_token='+token);
            stompClient = Stomp.over(socket);
            stompClient.connect({}, onConnected, onError);
        })
        .catch(error => console.log('error', error));;


    }
    event.preventDefault();
}

function senderId() {
    return username == 'bigfreakguy' ? 239 : 238
}

function receiverId() {
    return username == 'bigfreakguy' ? 238 : 239
}

function onConnected() {
    // Subscribe to the user Topic
    var header = {"X-AUTH-HEADER": access_token}
    const userId = senderId()
    stompClient.subscribe('/user/' + userId + '/match/'+matchId, onMessageReceived, header);

    connectingElement.classList.add('hidden');
}


function onError(error) {
    connectingElement.textContent = 'Could not connect to WebSocket server. Please refresh this page to try again!';
    connectingElement.style.color = 'red';
}


function sendMessage(event) {
    var messageContent = messageInput.value.trim();
    if(messageContent && stompClient) {
        var chatMessage = {
            senderId: senderId(),
            content: messageInput.value,
            receiverId: receiverId() ,
            type: 'CHAT'
        };
        stompClient.send("/messenger/matches/" + matchId + "/chat", {}, JSON.stringify(chatMessage));
        messageInput.value = '';
    }
    event.preventDefault();
}



function onMessageReceived(payload) {
    var message = JSON.parse(payload.body);

    var messageElement = document.createElement('li');

    if (message.type === 'AUDIO') {
        messageElement.classList.add('chat-message');

        var avatarElement = document.createElement('i');
        var avatarText = document.createTextNode(message.senderId);
        avatarElement.appendChild(avatarText);
        avatarElement.style['background-color'] = getAvatarColor(message.senderId);

        messageElement.appendChild(avatarElement);


        var p = document.createElement('p');
        var audioelement = document.createElement('audio');
        audioelement.setAttribute("src", message.attachmentUrl);
        audioelement.setAttribute("preload", true);
        audioelement.setAttribute("controls", true);
        p.appendChild(audioelement);

        messageElement.appendChild(p);
    } else {
        messageElement.classList.add('chat-message');

        var avatarElement = document.createElement('i');
        var avatarText = document.createTextNode(message.senderId);
        avatarElement.appendChild(avatarText);
        avatarElement.style['background-color'] = getAvatarColor(message.senderId);

        messageElement.appendChild(avatarElement);

        var usernameElement = document.createElement('span');
        var usernameText = document.createTextNode(message.senderId);
        usernameElement.appendChild(usernameText);
        messageElement.appendChild(usernameElement);


        var textElement = document.createElement('p');
        var messageText = document.createTextNode(message.content);
        textElement.appendChild(messageText);

        messageElement.appendChild(textElement);
    }


    messageArea.appendChild(messageElement);
    messageArea.scrollTop = messageArea.scrollHeight;
}


function getAvatarColor(senderId) {
    var hash = 0;
    for (var i = 0; i < senderId / 8; i++) {
        hash = 31 * hash + senderId;
    }
    var index = Math.abs(hash % colors.length);
    return colors[index];
}

function getToken(username) {
    var myHeaders = new Headers();
    myHeaders.append("Content-Type", "application/x-www-form-urlencoded");

    var urlencoded = new URLSearchParams();
    urlencoded.append("grant_type", "password");
    urlencoded.append("client_id", "OAD");
    urlencoded.append("username", username);
    urlencoded.append("password", "pass");

    var requestOptions = {
    method: 'POST',
    headers: myHeaders,
    body: urlencoded,
    redirect: 'follow'
    };

    return fetch("http://x.x.x.x:8080/realms/once_a_day/protocol/openid-connect/token", requestOptions);
}

function sendAudioMessage(base) {
    const headers = new Headers();
    headers.append('Content-Type', 'application/json');
    headers.append('Authorization', 'Bearer ' + access_token);
    headers.append('Access-Control-Allow-Origin', '*');

    var raw = JSON.stringify({
        "senderId": senderId(),
        "receiverId": receiverId(),
        "type": "AUDIO",
        "content": base
      });

    var requestOptions = {
        method: 'POST',
        headers: headers,
        body: raw
    };

    fetch("http://x.x.x.x:8091/matches/5/chat", requestOptions)
        .then(response => response.text())
        .then(result => console.log(result))
        .catch(error => console.log('error', error));
}

const startButton = document.getElementById('start');
      const stopButton = document.getElementById('stop');
      const playButton = document.getElementById('play');
      const sendButton = document.getElementById('send');
      const audio = document.getElementById('audio');
      let output = document.getElementById('output');
      let audioRecorder;
      let audioChunks = [];
      navigator.mediaDevices.getUserMedia({ audio: true })
         .then(stream => {
         
            // Initialize the media recorder object
            audioRecorder = new MediaRecorder(stream);
            
            // dataavailable event is fired when the recording is stopped
            audioRecorder.addEventListener('dataavailable', e => {
               audioChunks.push(e.data);
            });
            
            // start recording when the start button is clicked
            startButton.addEventListener('click', () => {
               audioChunks = [];
               audioRecorder.start();
               output.innerHTML = 'Nagrywam ;)';
            });
            
            // stop recording when the stop button is clicked
            stopButton.addEventListener('click', () => {
               audioRecorder.stop();
               output.innerHTML = 'Skończyłem :>';
            });
            
            // play the recorded audio when the play button is clicked
            playButton.addEventListener('click', () => {
                const blobObj = new Blob(audioChunks, { type: 'audio/webm' });
                const audioUrl = URL.createObjectURL(blobObj);
                const audio = new Audio(audioUrl);
                audio.play();
                output.innerHTML = 'Nawijam!';
            });

            sendButton.addEventListener('click', () => {
                console.log('reading')
                const blobObj = new Blob(audioChunks, { type: 'audio/mpeg-3' });
                const fileReader = new FileReader();
                fileReader.onload = function() {
                  const base64String = fileReader.result.split(',')[1];
                    console.log(base64String)
                  sendAudioMessage(base64String)
                };
                
                fileReader.readAsDataURL(blobObj);
                output.innerHTML = '';
             });
            
         }).catch(err => {
         
            // If the user denies permission to record audio, then display an error.
            console.log('Error: ' + err);
         });
        
         audio.addEventListener('change', (event) => {
            const fileReader = new FileReader();
            fileReader.onload = function() {
              const base64String = fileReader.result.split(',')[1];
                console.log(base64String)
              sendAudioMessage(base64String)
            };
            
            fileReader.readAsDataURL(audio.files[0]);
         })
usernameForm.addEventListener('submit', connect, true)
